for q_data in questions_data:
    question = Question(
        title=q_data["title"],
        text=q_data["text"],
        image=q_data["image"],
        position=q_data["position"],
    )

    q_id = question_dao.insert_question(question)

    for index, (text, is_correct) in enumerate(q_data["answers"], start=1):
        answer = Reponse(
            question_id=q_id,
            answer_index=index,
            text=text,
            isCorrect=is_correct,
        )
        question_dao.insert_answer(answer)

print("Database seeded successfully with dinosaur questions 🦖")
